import React from "react";
// index에서 render를 이용해 하나의 function만 가능하므로 정의한 함수에 파편적으로 넣을 것
function Apple() {
  return (
    <h1>I like apple</h1>
  )
}


function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Apple />
    </div >
  );
}

export default App;
